Greetings to All Esteemed Home Owners, Investors and Developers!;Welcome to my web page. I am Wendy Soh, a Registered Probationary Real Estate Agent with the Hartamas Real Estate (Malaysia) Sdn. Bhd. 


My Tag-Line in Life is: IF ANYTHING IS WORTH DOING, DO IT WITH ALL YOUR HEART; This has always being my personal success formula! The Client-Agent-Home Owners Relationship is built on MUTUAL TRUST, DEDICATION AND SACRIFICE and this relationship does not end with the conclusion of a successful, win-win deal for both parties. It should be a PERPETUAL RELATIONSHIP! 

I believe that being a person with a strong sense of Responsibility, a passion for Excellence, possessing the Right Aptitude and armed with the Right Personal Perseverance, we will succeed in whatever we do if we Do It with A Sincere and Pure Heart!;


About my professional standing: I was the former Director and Member of the Board of a Public Listed Company, a Multinational Manufacturing Company listed on the Main Board of Bursa Malaysia, in charge of Finance, Risk Management and Internal Audit functions. I am also a Chartered Company Secretary registered with MAICSA, and former Associate Member of the Financial Planning Association of Malaysia (FPAM) and former Associate Member of the Institute of Internal Auditors (AIIA).

Please do not hesitate to contact me if you have any interest in selling/buying/renting your current properties, or making an investment. Let me help you Achieve Your Dreams!

I am a dedicated full time real estate negotiator concentrate selling and renting properties in Setia Eco Park, Setia Alam;

If you’re looking to buy, sell or rent in Setia Eco Park, you’ve found the right personnel.&amp;amp;amp;amp;amp;amp;#160;If you have any
enquiry, please kindly give me a call @ 012-6597775. Thank you.

